export default function DateTimeToString(date) {
    let newDate = new Date(date);
    let stringDate = newDate.getUTCFullYear() + "-" + (To2digit(newDate.getUTCMonth() + 1)) +
        "-" + To2digit(newDate.getUTCDay()) + "T" + To2digit(newDate.getUTCHours()) + ":" + To2digit(newDate.getUTCMinutes());
    return stringDate === 'Invalid Date' ? '' : stringDate;
}

function To2digit(num) {
    if (num >= 0 && num <= 9) {
        return '0' + num;
    }
    return num;
}
